import Header from "./header";
import Cart from "./cart";
import Footer from "./footer";
import BackToTop from "./backToTop";

export default function Layout(props) {
  return (
    <>
      <head>
        <link rel="icon" type="image/png" href="images/icons/favicon.png" />
      </head>
      <Header />
      <Cart />
      {props.children}
      <Footer />
      <BackToTop />
    </>
  );
}
